One may wish to weight by the size of the view. For example, if 99% of the columns are in one view, and the two rows are together in the large view, but not the small view, we would like a row similarity of 99%, not 50%. For this reason, there is a column-weighted variant, which can be accessed by way of an extra argument to the rowsim function. \[ \bar{RS}(A, B) \frac{1}{S} \sum_{s \in S} \sum_{v \in V_s} \frac{|C_v|}{|C|} [v_a = v_b] \] where C is the set of all columns in the table and Cv is the number of columns in a given view, v. We can see the effect of column weighting when computing the row similarity of animals in the zoo dataset. from lace import examples animals = examples.Animals()
animals.clustermap('rowsim', color_continuous_scale='greys', zmin=0, zmax=1) Above. Standard row similarity for the animals data set. animals.clustermap( 'rowsim', color_continuous_scale='greys', zmin=0, zmax=1, fn_kwargs={'col_weighted': True}
) Above. Column-weighted row similarity for the animals data set. Note that the clusters are more pronounced.

