If you've used logp, you already understand how to simulate data. In both logp and simulate you define a distribution. In logp the output is an evaluation of a specific point (or points) in the distribution; in simulate you generate from the distribution. We can simulate from joint distributions from lace.examples import Animals animals = Animals() swims = animals.simulate(['swims'], n=10) Or we can simulate from conditional distributions swims = animals.simulate(['swims'], given={'flippers': 1}, n=10) If we want to create a debiased dataset we can do something like this: There are too many land animals in the animals dataset, we'd like an even representation of land and aquatic animals. All we need to do is simulate from the conditionals and concatenate the results. import polars as pl n = animals.n_rows target_col = 'swims'
other_cols = [col for col in animals.columns if col != target_col] land_animals = animals.simulate( other_cols, given={target_col: 0}, n=n//2, include_given=True
) aquatic_animals = animals.simulate( other_cols, given={target_col: 1}, n=n//2, include_given=True
) df = pl.concat([land_animals, aquatic_animals]) That's it! We introduced a new keyword argument, include_given, which includes the given conditions in the output so we don't have to add them back manually.
